import { useState } from "react";
import { Autocomplete } from '../components/Autocomplete';

export const SearchComponent = ({ setSearchQuery, setResultsVisible, suggestions, setShowSuggestions }) => {
    const [seachInput, setSearchInput] = useState("");

    const handleSubmit = (e) => {
        e.preventDefault();
        setSearchQuery(seachInput)
        setResultsVisible(true)
    }

    const inputValue = (userInput) => {
        console.log('handleIninputValueputTest', userInput);
        setSearchInput(userInput)
    }

    return (
        <section id="search-component">
            <form id="search-form" onSubmit={value => handleSubmit(value)}>
                <label>
                    <Autocomplete
                        suggestions={suggestions}
                        inputValue={userInput => inputValue(userInput)}
                        seachInput={seachInput}
                        setShowSuggestions={(e) => setShowSuggestions(e)}
                    />
                </label>
                <button
                    type="submit"
                    value="Submit">
                    Zoek adviseurs
                </button>
            </form>
        </section >
    )
}
